import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import './Navbar.css';
import Logo from './logo.png';
import {Login} from '../Login';

export function Navbar() {
    return (
        <>
            <div className="App">avd</div>
                <Link to="/home">Login</Link>
                <Link to="/abc">Login</Link>

            <header>
                <nav>
                    <img className="navbar-brand-logo" alt="logo" src={Logo} />
                    <h1>AIRTRACK</h1>
                    <div className="nav-links">
                        <ul>
                            <Link to="/">Home</Link>

                            <li><a href="appointment.html">FLIGHTS</a></li>
                            <li><a href="complaint.html">BOOKING</a></li>
                            <li><a href="complaint.html">PROFILE</a></li>
                            <li><a href="loginsign.html">CONTACT</a></li>
                            <li><a href="loginsign.html">LOGOUT</a></li>
                        </ul>
                    </div>
                </nav>
            </header>

        </>
    );
}
